import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/login" element={<div>Login Page</div>} />
                {/* This is a basic test route, it should show "Login Page" */}
            </Routes>
        </Router>
    );
};

export default App;
